/*Table structure for table `tbl_user` */

DROP TABLE IF EXISTS `tbl_user`;

CREATE TABLE `tbl_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `login_account` varchar(64) DEFAULT NULL,
  `login_password` varchar(768) DEFAULT NULL,
  `category` varchar(8) DEFAULT NULL,
  `email` varchar(128) DEFAULT NULL,
  `activate` int(11) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `introducer` varchar(64) DEFAULT NULL,
  `login_times` int(11) DEFAULT NULL,
  `last_login_date` datetime DEFAULT NULL,
  `boao_score` int(11) DEFAULT NULL,
  `boao_coint` decimal(10,0) DEFAULT NULL,
  `pwd_question` varchar(128) DEFAULT NULL,
  `pwd_answer` varchar(128) DEFAULT NULL,
  `nick_name` varchar(24) DEFAULT NULL,
  `photo` varchar(512) DEFAULT NULL,
  `province` varchar(24) DEFAULT NULL,
  `city` varchar(12) DEFAULT NULL,
  `county` varchar(24) DEFAULT NULL,
  `address` varchar(256) DEFAULT NULL,
  `mobile_phone` varchar(24) DEFAULT NULL,
  `telephone` varchar(32) DEFAULT NULL,
  `qq` varchar(18) DEFAULT NULL,
  `msn` varchar(128) DEFAULT NULL,
  `recieve_msg` int(11) DEFAULT NULL,
  `recieve_notify` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
